import React from "react"
import { Component } from "react";
export default class Login extends Component{
    render(){
        return(
            <>
            <div>
            <div >
            <h1 class="logo">
            <img class="logo-icon" src="Revvsales_logo.png" style={{width:"20%",height:"10%"}}/>
            </h1>
          </div>
            </div>
            </>
        )
    }
}
